dataItem.expression:
if([Presentation].[Fact].[Fiscal Year] < [Year Prompt Value])
then (0 - [Presentation].[Fact].[Invoice Pounds])
else ([Presentation].[Fact].[Invoice Pounds])

if ([Presentation].[Fact].[Fiscal Year] < [Year Prompt Value])
then (0 - [Presentation].[Fact].[Net Sales])
else ([Presentation].[Fact].[Net Sales])

if ([Presentation].[Fact].[Fiscal Year] < [Year Prompt Value])
then (0 - [Presentation].[Fact].[Combined EBIT])
else ([Presentation].[Fact].[Combined EBIT])

if( [Presentation].[Fact].[Fiscal Year] >= [Year Prompt Value] )
then ([Presentation].[Fact].[Invoice Pounds])
else (0)

if( [Presentation].[Fact].[Fiscal Year] <  [Year Prompt Value])
then ('Prior Year ')
else ('Current Year ')

if([Presentation].[Fact].[Fiscal Year] >= [Year Prompt Value])
then ([Presentation].[Fact].[Invoice Pounds])
else (0)

if([Presentation].[Fact].[Fiscal Year] < [Year Prompt Value])
then ([Presentation].[Fact].[Invoice Pounds])
else (0)

if([Presentation].[Fact].[Fiscal Year] >= [Year Prompt Value])
then ([Presentation].[Fact].[Net Sales])
else (0)

if([Presentation].[Fact].[Fiscal Year] < [Year Prompt Value])
then ([Presentation].[Fact].[Net Sales])
else (0)

if([Presentation].[Fact].[Fiscal Year] >= [Year Prompt Value])
then ([Presentation].[Fact].[Combined EBIT])
else (0)

if([Presentation].[Fact].[Fiscal Year] < [Year Prompt Value])
then ([Presentation].[Fact].[Combined EBIT])
else (0)

detailFilter.filterExpression:
if (?p_year? = 'Current')
then ([Presentation].[Fact].[Current Fiscal Year] = 'Y' OR [Presentation].[Fact].[Current Fiscal Year] = 'PY')
else ([Presentation].[Fact].[Fiscal Year] = ?p_year? OR [Presentation].[Fact].[Fiscal Year] = ?p_year? - 1)

if(?p_quarter? = 'Current')
then([Presentation].[Fact].[Current Fiscal Quarter] = 'Y' OR [Presentation].[Fact].[Current Fiscal Quarter] = 'PY')
else([Presentation].[Fact].[Fiscal Quarter] = ?p_quarter?)

if(?p_YTD? = 'Y')
then([Presentation].[Fact].[Fiscal Quarter] between '1' and [PrevQuarter])
else([Presentation].[Fact].[Fiscal Quarter] in (1, 2, 3, 4))
